import React from 'react';
import '../css/Home.css';

import { useNavigate } from 'react-router-dom'; 

import aiImage from '../img/1.jpeg';
import mlImage from '../img/2.jpeg';
import dsImage from '../img/3.jpeg';

function Home() {
    const navigate = useNavigate();

    const goToAiMlPage = () => {
        navigate('/aiml');
    }
    return (
        <div className="home-container">
            <div className="introduction">
                <h1>Welcome to AI/ML HUB</h1>
                <p>Your journey into the world of Artificial Intelligence and Machine Learning starts here.</p>
            </div>
            <div className="sections-container">
                <div className="section">
                    <img src={aiImage} alt="Artificial Intelligence" />
                    <h2>Artificial Intelligence</h2>
                    <p>Brief description of AI...</p>
                    <button onClick={() => {/* Navigate to AI course */}}>Learn AI</button>
                </div>

                <div className="section">
                    <img src={mlImage} alt="Machine Learning" />
                    <h2>Machine Learning</h2>
                    <p>Brief description of Machine Learning...</p>
                    <button onClick={() => {/* Navigate to ML course */}}>Learn ML</button>
                </div>

                <div className="section">
                    <img src={dsImage} alt="Data Science" />
                    <h2>Data Science</h2>
                    <p>Brief description of Data Science...</p>
                    <button onClick={() => {/* Navigate to DS course */}}>Learn Data Science</button>
                </div>
            </div>
        </div>
    );
}

export default Home;
